import struct
from Crypto.Util.number import long_to_bytes

def float_to_bits(f):
    # Pack the float into 8 bytes using IEEE 754 format (double precision)
    packed = struct.pack('>d', f)
    
    # Convert the packed bytes to an integer representation
    bits = int.from_bytes(packed, byteorder='big')
    
    # Convert to binary string for visualization
    binary_representation = format(bits, '064b')
    
    return {
        'hex': hex(bits),
        'binary': binary_representation,
        'sign': binary_representation[0],
        'exponent': binary_representation[1:12],
        'fraction': binary_representation[12:]
    }

out = "0b"
for x in output:
    if "000000000000" == float_to_bits(x)['binary'][-12:]:
        out+="1"
    else:
        out+="0"
long = eval(out)
print(long_to_bytes(long))